class Form extends React.Component {
  constructor() {
    super()
    this.state = {
      estadoFav: ''
    }
  }
render() {
  return(
    <div>
      <h1>Estados e React</h1>
      <form>
        <label>Estado Favorito?</label>
        <textarea name="estadoFavorito" />
      </form>
    </div>
  )
}
}

export default Form
